class Solution(object):
    def matrixBlockSum(self, mat, K):
        """
        :type mat: List[List[int]]
        :type K: int
        :rtype: List[List[int]]
        """
        n = len(mat)
        m = len(mat[0])
        print(n,m)
        ans = [[0] * m for _ in range(n)]
        s = 0
        for i in mat:
            s += sum(i)
        # print(s)
        for y in range(n):
            for x in range(m):
                if max(0, y-K) == 0 and min(n-1, y+K)+1 == n and max(0, x-K) == 0 and min(m-1, x+K)+1 == m:
                    ans[y][x] = s
                else:
                    for j in range(max(0, y-K), min(n-1, y+K)+1):
                        ans[y][x] += sum(mat[j][max(0, x-K): min(m-1, x+K)+1])
                        # for i in range(max(0, x-K), min(m-1, x+K)+1):
                        #     ans[y][x] += mat[j][i]
        return ans

mat = [[1,2,3],[4,5,6],[7,8,9]]
K = 1
res = Solution().matrixBlockSum(mat, K)
print(res)

